<template><h1 id="vue函数式组件" tabindex="-1"><a class="header-anchor" href="#vue函数式组件" aria-hidden="true">#</a> vue函数式组件</h1>
<p>Vue.js 组件提供了一个 functional 开关，设置为 true 后，就可以让组件变为无状态、无实例的函数化组件。因为只是函数，所以渲染的开销相对来说，较小。<br></p>
<p>函数化的组件中的 Render 函数，提供了第二个参数 context 作为上下文，包含data、props、slots、children 以及 parent 都可以通过 context 来访问。</p>
